The Pikes Peak International Hill Climb begins at 9,390 feet and finishes at 14,115 feet. There are almost no safety barriers, and it's regarded as one of the most dangerous motorsport events on Earth. Who wants to enter such a dangerous event? And how do you film it? 

JF Musial, co-director of the Motor Trend docu-series "Pikes Peak: On the Edge", talks about the race, the cars, the drivers, and how they captured it all. The series is a must-see.

